import React from 'react';
import styled from 'styled-components';

import './App.css';

const App = () => (
  <div className="App">
    <header className="App-header">
      <a className="App-link" href="https://reactjs.org" target="_blank" rel="noopener noreferrer">
        Learn React
      </a>
    </header>
  </div>
);

export default App;
